import flash.display.MovieClip;

var hit:MovieClip;
var hit2:MovieClip;

var enemiesArr:Array;

init();

function init ():void {
	enemiesArr = MovieClip(parent.parent).enemiesArr;
}

function update ():void {



}

function hitEnemies():void {
	if (hit || hit2) {
		for (var i:int = 0; i < enemiesArr.length; i ++) {
			var en:MovieClip = enemiesArr[i];
			if (hit) {
				if (en && en.bound.hitTestObject(hit) && en.currentFrameLabel != "death") {
					en.takeDamage(this, 7, 7, 4);
				}
			}
			if (hit2) {
				if (en && en.bound.hitTestObject(hit2) && en.currentFrameLabel != "death") {
					en.takeDamage(this, 16, 12, 4);
				}
			}
		}
	}
}
